        <h1>üëë ÁÆ°ÁêÜÂëòÊ≥®ÂÜå</h1>

        {error && <div className="error-message">{error}</div>}
        {success && <div className="success-message">{success}</div>}

        <form onSubmit={handleSubmit}>
          <div className="form-row">
            <div className="form-group">
              <label>Â∑•Âè∑Ôºö<span className="required-mark">*</span></label>
              <input
                type="text"
                value={form.username}
                onChange={(e) => setForm({...form, username: e.target.value})}
                required
                placeholder="ËØ∑ËæìÂÖ•Â∑•Âè∑"
                autoComplete="username"
              />
            </div>

            <div className="form-group">
              <label>ÂßìÂêçÔºö<span className="required-mark">*</span></label>
              <input
                type="text"
                value={form.name}
                onChange={(e) => setForm({...form, name: e.target.value})}
                required
                placeholder="ËØ∑ËæìÂÖ•ÂßìÂêç"
                autoComplete="name"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>ÂØÜÁ†ÅÔºö<span className="required-mark">*</span></label>
              <input
                type="password"
                value={form.password}
                onChange={(e) => setForm({...form, password: e.target.value})}
                required
                placeholder="ËØ∑ËæìÂÖ•ÂØÜÁ†ÅÔºàËá≥Â∞ë6‰ΩçÔºâ"
                autoComplete="new-password"
                minLength="6"
              />
            </div>

            <div className="form-group">
              <label>Á°ÆËÆ§ÂØÜÁ†ÅÔºö<span className="required-mark">*</span></label>
              <input
                type="password"
                value={form.confirmPassword}
                onChange={(e) => setForm({...form, confirmPassword: e.target.value})}
                required
                placeholder="ËØ∑ÂÜçÊ¨°ËæìÂÖ•ÂØÜÁ†Å"
                autoComplete="new-password"
                minLength="6"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>ÈÇÆÁÆ±Ôºö</label>
              <input
                type="email"
                value={form.email}
                onChange={(e) => setForm({...form, email: e.target.value})}
                placeholder="ËØ∑ËæìÂÖ•ÈÇÆÁÆ±Âú∞ÂùÄÔºàÂèØÈÄâÔºâ"
                autoComplete="email"
              />
            </div>

            <div className="form-group">
              <label>ÊâãÊú∫Âè∑Ôºö</label>
              <input
                type="tel"
                value={form.phone}
                onChange={(e) => setForm({...form, phone: e.target.value})}
                placeholder="ËØ∑ËæìÂÖ•ÊâãÊú∫Âè∑Á†ÅÔºàÂèØÈÄâÔºâ"
                autoComplete="tel"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label>Â≠¶Ê†°Ôºö</label>
              <input
                type="text"
                value={form.school_id}
                onChange={(e) => setForm({...form, school_id: e.target.value})}
                placeholder="ËØ∑ËæìÂÖ•Â≠¶Ê†°ÂêçÁß∞ÔºàÂèØÈÄâÔºâ"
              />
            </div>

            <div className="form-group">
              <label>Èô¢ÈÉ®Ôºö</label>
              <input
                type="text"
                value={form.major_id}
                onChange={(e) => setForm({...form, major_id: e.target.value})}
                placeholder="ËØ∑ËæìÂÖ•Èô¢ÈÉ®ÂêçÁß∞ÔºàÂèØÈÄâÔºâ"
