            </div>
          </div>

          <div className="form-actions">
            <button type="submit" className="register-btn" disabled={loading}>
              {loading ? 'Ê≥®ÂÜå‰∏≠...' : 'Ê≥®ÂÜåÁÆ°ÁêÜÂëò'}
            </button>

            <button 
              type="button" 
              className="back-btn"
              onClick={() => navigate('/login')}
            >
              ËøîÂõûÁôªÂΩï
            </button>
          </div>
        </form>

        <div className="register-info">
          <div className="info-box">
            <p>üí° ÁÆ°ÁêÜÂëòÊ≥®ÂÜåËØ¥ÊòéÔºö</p>
            <ul>
              <li>Â∑•Âè∑ÂíåÂßìÂêç‰∏∫ÂøÖÂ°´È°πÔºåÊ≥®ÂÜåÂêé‰∏çÂèØ‰øÆÊîπ</li>
              <li>ÂØÜÁ†ÅÈïøÂ∫¶Ëá≥Â∞ë6‰Ωç</li>
