              <li>Ê≥®ÂÜåÊàêÂäüÂêéËØ∑Â¶•ÂñÑ‰øùÁÆ°Ë¥¶Âè∑‰ø°ÊÅØ</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminRegisterPage;
